// frontend/src/api.js

import axios from "axios";

const API_URL = "http://localhost:8000/api";

export const fetchStocks = () => axios.get(`${API_URL}/stocks/`);
export const fetchTrades = () => axios.get(`${API_URL}/trades/`);
export const fetchWallet = () => axios.get(`${API_URL}/wallets/`);
export const fetchPortfolio = () => axios.get(`${API_URL}/portfolios/`);
